				(to_integer(unsigned(addr)) <= END_ADDRESS)) then
			EN <= '1';
		else
			EN <= '0';
		end if;
	end process;

	MEMORY: process (clk)
	begin
		if (rst = '0' and READ_ONLY = '0') then
			RAM <= (others => (others => '0'));
		else
			if (rising_edge(clk)) then
				if (state = WRITE and READ_ONLY = '0') then
